import{_ as t,c as r,o as i,aM as a}from"./chunks/framework.DAyGILei.js";const h=JSON.parse('{"title":"Price list","description":"This page holds the current price list for HUNT Cloud.","frontmatter":{"title":"Price list","category":"HUNT Cloud","permalink":"/administer-science/prices/pricelist","outline":2,"description":"This page holds the current price list for HUNT Cloud."},"headers":[],"relativePath":"administer-science/prices/pricelist.md","filePath":"administer-science/prices/pricelist.md"}'),s={name:"administer-science/prices/pricelist.md"};function o(l,e,n,d,c,u){return i(),r("div",null,[...e[0]||(e[0]=[a('<h1 id="price-list" tabindex="-1">Price list <a class="header-anchor" href="#price-list" aria-label="Permalink to &quot;Price list&quot;">​</a></h1><p><strong>This page lists the prices for our cloud services. The price list is incorporated as an appendix to cloud services agreement, and costs are metered and billed in accordance with our <a href="/administer-science/services/specifications">services specifications</a>.</strong></p><nav class="table-of-contents"><ul><li><a href="#current">Current</a></li><li><a href="#updates">Updates</a></li><li><a href="#archive">Archive</a></li><li><a href="#changes">Changes</a></li></ul></nav><p>Head over to our <a href="/administer-science/prices/calculator">price calculator</a> to tailor cost estimates for you desired configuration, or visit our <a href="/administer-science/prices/examples">price examples</a> for commonly used configurations.</p><h2 id="current" tabindex="-1">Current <a class="header-anchor" href="#current" aria-label="Permalink to &quot;Current&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">CURRENT PRICE LIST</p><p><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-5-0.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List</a> (v5.0 PDF)</p></div><p><strong>Machine readable version of current price list:</strong> The table below include a machine readable CSV of the current price list (v5). The PDF version holds precedence if discrepancies occur.</p><table tabindex="0"><thead><tr><th><strong>Content</strong></th><th><strong>Type</strong></th><th><strong>File</strong></th></tr></thead><tbody><tr><td>HUNT Cloud Price List (v5.0)</td><td>PDF</td><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-5-0.pdf" target="_blank" rel="noreferrer">hunt-cloud-price-list-5-0.pdf</a></td></tr><tr><td>HUNT Cloud Price List (v5.0)</td><td>CSV*</td><td><a href="https://assets.hdc.ntnu.no/assets/prices/v5/hunt-cloud-price-list-5-0.csv" target="_blank" rel="noreferrer">hunt-cloud-price-list-5-0.csv</a></td></tr></tbody></table><p>*) The current CSV version do not contain prices for transport services, hourly based services and tape services.</p><h2 id="updates" tabindex="-1">Updates <a class="header-anchor" href="#updates" aria-label="Permalink to &quot;Updates&quot;">​</a></h2><p>The price list will be updated from time to time.</p><p><strong>Major updates</strong>. Major updates affect prices and/or available services. Major updates are specified by increasing numbers (v1, v2, v3, etc.). These become effective ninety days after they are announcement to service centers and data spaces on email. The new version is immediately effective for new service centers.</p><p><strong>Minor updates</strong>. Major updates do -not- affect prices and/or available services. Minor updates are specified by increasing decimals (v2.1, v2.2, v2.3, etc). Minor updates follow the effective date of major updates and take precedence of previous versions when they are published on this page.</p><h2 id="archive" tabindex="-1">Archive <a class="header-anchor" href="#archive" aria-label="Permalink to &quot;Archive&quot;">​</a></h2><table tabindex="0"><thead><tr><th><strong>Version</strong></th><th><strong>Type</strong></th><th><strong>Announced</strong></th><th><strong>Effective</strong></th></tr></thead><tbody><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-5-0.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v5.0</a> (PDF)</td><td>Minor</td><td>2025-07-01</td><td>2025-10-01</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-5.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.5</a> (PDF)</td><td>Minor</td><td>2025-05-08</td><td>2025-05-08</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-4.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.4</a> (PDF)</td><td>Minor</td><td>2025-02-15</td><td>2025-02-15</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-3.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.3</a> (PDF)</td><td>Minor</td><td>2025-02-11</td><td>2025-02-11</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-2.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.2</a> (PDF)</td><td>Minor</td><td>2024-06-26</td><td>2024-06-26</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-1.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.1</a> (PDF)</td><td>Minor</td><td>2024-04-23</td><td>2024-04-23</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-4-0.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v4.0</a> (PDF)</td><td>MAJOR</td><td>2022-10-10</td><td>2023-01-10</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-3-2.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v3.2</a> (PDF)</td><td>Minor</td><td>2022-02-22</td><td>2022-02-22</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-3-1.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v3.1</a> (PDF)</td><td>Minor</td><td>2021-10-12</td><td>2021-10-12</td></tr><tr><td><a href="https://assets.hdc.ntnu.no/assets/prices/hunt-cloud-price-list-3-0.pdf" target="_blank" rel="noreferrer">HUNT Cloud Price List v3.0</a> (PDF)</td><td>MAJOR</td><td>2021-07-01</td><td>2021-10-01</td></tr></tbody></table><h2 id="changes" tabindex="-1">Changes <a class="header-anchor" href="#changes" aria-label="Permalink to &quot;Changes&quot;">​</a></h2><h4 id="hunt-cloud-price-list-v5-0-major" tabindex="-1">HUNT Cloud Price list v5.0 (MAJOR) <a class="header-anchor" href="#hunt-cloud-price-list-v5-0-major" aria-label="Permalink to &quot;HUNT Cloud Price list v5.0 (MAJOR)&quot;">​</a></h4><p>New prices are adjusted based on updated equipment and operational costs since the last price adjustments in 2022. Percentages below are approximations for comparison. Accompanying services updates are described under <a href="/administer-science/services/#hunt-cloud-services-specification-v3-0-major">HUNT Cloud Services Specification v3.0</a> (MAJOR).</p><p><em>Data space subscriptions</em></p><ul><li>Costs are removed for all data space subscription levels.</li><li>EXPLORE and EVOLVE are introduced as new data space subscription levels for improved lab portfolio management for departments and to encourage growth of emerging data spaces.</li><li>WHITE, BLUE and ORANGE subscription levels are removed.</li></ul><p><em>Lab subscriptions</em></p><ul><li>Subscription prices are increased with 60%.</li><li>Changes reflect operational costs previously incorporated into data space subscriptions.</li></ul><p><em>Compute</em></p><ul><li>COMMITMENT prices are increased with 30-40%.</li><li>ON-DEMAND prices are increased with 5% and are now at a similar levels as COMMITMENT prices.</li><li>SPOT prices are introduced as the new cost effective machine alternative. These prices are 30-40% increased compared to BLUE prices, and kept at 50% of COMMITMENT and ON-DEMAND.</li><li>BLUE prices are removed.</li><li>GPU pricing is simplified to ON-DEMAND only.</li><li>GPU NVIDIA P100 is phased out and removed from the selection.</li></ul><p><em>Store</em></p><ul><li>Regular storage price is increased with 20-30%.</li><li>NVMe is introduced as an speed-optimized storage option.</li><li>Tape prices is now prices per pair regardless of volume.</li></ul><h4 id="hunt-cloud-price-list-v4-5-minor" tabindex="-1">HUNT Cloud Price list v4.5 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v4-5-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v4.5 (minor)&quot;">​</a></h4><p><em>Compute updates</em></p><ul><li>A new GPU accelerator (NVIDIA L40S) is included.</li></ul><h4 id="hunt-cloud-price-list-v4-4-minor" tabindex="-1">HUNT Cloud Price list v4.4 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v4-4-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v4.4 (minor)&quot;">​</a></h4><p><em>Compute updates</em></p><ul><li>Memory corrected for one GPU accelerator (NVIDIA V100) from 16G to 32g.</li></ul><h4 id="hunt-cloud-price-list-v4-3-minor" tabindex="-1">HUNT Cloud Price list v4.3 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v4-3-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v4.3 (minor)&quot;">​</a></h4><p><em>Compute updates</em></p><ul><li>A new GPU accelerator (NVIDIA A16) is included.</li></ul><h4 id="hunt-cloud-price-list-v4-2-minor" tabindex="-1">HUNT Cloud Price list v4.2 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v4-2-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v4.2 (minor)&quot;">​</a></h4><p><em>Store update</em></p><ul><li>Legend of block storage table updated to reflect that prices in the table are for one terabyte.</li></ul><h4 id="hunt-cloud-price-list-v4-1-minor" tabindex="-1">HUNT Cloud Price list v4.1 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v4-1-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v4.1 (minor)&quot;">​</a></h4><p><em>Compute updates</em></p><ul><li>The new E-series machine type (default.e) is included with 16 GB of memory per vCPU.</li><li>A new GPU accelerator (NVIDIA A40) is included.</li></ul><h4 id="hunt-cloud-price-list-v4-0-major" tabindex="-1">HUNT Cloud Price list v4.0 (MAJOR) <a class="header-anchor" href="#hunt-cloud-price-list-v4-0-major" aria-label="Permalink to &quot;HUNT Cloud Price list v4.0 (MAJOR)&quot;">​</a></h4><p>The new prices are adjusted based on updated equipment cost, and evaluations of 2022 usage and rates for Q2-Q3 towards our initial cost-recovery estimates for our v3 price list.</p><p><em>Services updates</em></p><ul><li>BLUE data space subscription open for 3Y commitment.</li><li>Compute CPU default machine types expanded with larger machine types.</li><li>Compute GPU types expanded with A100 40GB, A100 80GB and A30 24GB accelerators.</li></ul><p><em>Price updates</em></p><ul><li>Storage prices are increased with 1-2%.</li><li>Services subscriptions are increased about 4%.</li><li>Compute default machine type prices for COMMIT and ONDEMAND service levels are reduced compared to the v3 price list, up to 30% for memory intensive machine types.</li><li>Compute default machine types for the BLUE service level are increased up to 30% (mean 50% of 1Y COMMIT prices in v4 compared to 35% in v3).</li><li>Prices for external transport on WHITE subscription level removed.</li></ul><h4 id="hunt-cloud-price-list-v3-2-minor" tabindex="-1">HUNT Cloud Price list v3.2 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v3-2-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v3.2 (minor)&quot;">​</a></h4><ul><li>Minor format updates.</li></ul><h4 id="hunt-cloud-price-list-v3-1-minor" tabindex="-1">HUNT Cloud Price list v3.1 (minor) <a class="header-anchor" href="#hunt-cloud-price-list-v3-1-minor" aria-label="Permalink to &quot;HUNT Cloud Price list v3.1 (minor)&quot;">​</a></h4><ul><li>GPU type in GPU table updated to machine readable names.</li><li>Document information with revision numbers included in PDF.</li><li>Machine readable version available on this page.</li></ul><h4 id="hunt-cloud-price-list-v3-0-major" tabindex="-1">HUNT Cloud Price list v3.0 (MAJOR) <a class="header-anchor" href="#hunt-cloud-price-list-v3-0-major" aria-label="Permalink to &quot;HUNT Cloud Price list v3.0 (MAJOR)&quot;">​</a></h4><ul><li>First version published under the new services model.</li></ul>',53)])])}const m=t(s,[["render",o]]);export{h as __pageData,m as default};
